import React from 'react';
import './LoginPage.css'; // Import your CSS file

function LoginPage() {
  return (
    <div className="login-container">
      {/* Left Side - Image */}
      <div className=" d-none d-md-block image-container">
        <img 
          src="https://d2cbg94ubxgsnp.cloudfront.net/Pictures/2000xAny/9/4/0/522940_shutterstock_1073661338_384074.jpg" 
          alt="Login Illustration" 
          className="login-image"
        />
      </div>

      {/* Right Side - Form */}
      <div className="form-container">
        <form className='d-none d-md-block col-12 col-6 py-4 px-1'>
          <h4 className="login-title text-center">Login</h4>
          {/* Add your form fields here */}

          <div className='form-floating mb-3'>
             <label htmlFor=''>Username</label>
             <input type="text" className='form-control'id="username"></input>
         </div>

         <div className='form-floating mb-3'>
           <input type="text" className='form-control'id="username"></input>
           <label htmlFor=''>Unit</label>
         </div>

         <div className='form-floating mb-3'>
           <input type="password" className='form-control'id="password"></input>
           <label htmlFor='password'>Password</label>
         </div>

         <div className='text-center'>
           <button className='sign-in-btn'>
           Sign in
           </button>
         </div>
        </form>
      </div>
    </div>
  );
}
export default LoginPage;
